using GameClient.DTO;
using AdminClient.Services;
using Shared.AuthService;
using Shared.AuthState;
using Shared.Data;
using Shared.Tets;

namespace AdminClient.Tests;

public class UnitTest1 {
    private TestClient client;

    public UnitTest1() {
        TestUtil.ResetDatabase();
        client = new TestClient(BOB);
    }
    
    //Get Account
    [Fact]
    public async Task Test_Get_Account()
    {
        Account account = await client.AdminService.GetAccountAsync(new GetAccountRequest(1));
        
        Assert.Equal(1,account.AccountId);
        Assert.Equal("BenDover",account.Username);
        Assert.Equal(2,account.Status);
        Assert.Equal("",account.Description);
        Assert.Equal("julie@juliemail.dk",account.Email);
        Assert.Equal("Julie",account.FirstName);
        Assert.Equal("Bramsen",account.LastName);
    }
    
    
    //Update user 
    [Fact]
    public async Task Test_updateAccount()
    {
        Account accountToUpdate = await client.AdminService.GetAccountAsync(new GetAccountRequest(1));
        Assert.Equal("BenDover",accountToUpdate.Username);
        Assert.Equal("Julie", accountToUpdate.FirstName);
        Assert.Equal("Bramsen", accountToUpdate.LastName);
        Assert.Equal("", accountToUpdate.Description);
        Assert.Equal("julie@juliemail.dk",accountToUpdate.Email);
        Assert.Null(accountToUpdate.ProfilePicture);
        Assert.Null(accountToUpdate.ProfilePictureType);

        {
            //kan ikke ændre brugernavn til allerede taget
            accountToUpdate.Username = "rune";
            UpdateAccountResponse res = await client.AdminService.UpdateAccountAsync(new UpdateAccountRequest(accountToUpdate));
            Assert.Equal("Username already taken.", res.errorReason);
            Assert.NotEqual("rune",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.Username );
        }
        {
            //kan ikke sætte felter til tomme
            accountToUpdate.Username = "";
            accountToUpdate.FirstName = "";
            accountToUpdate.LastName = "";
            accountToUpdate.Description = new string('h',501);
            accountToUpdate.Email = "";
            UpdateAccountResponse res = await client.AdminService.UpdateAccountAsync(new UpdateAccountRequest(accountToUpdate));
            
            Assert.Equal("Tried to update username to empty string, but this field must be non-empty.\nTried to update first name to empty string, but this field must be non-empty.\nTried to update last name to empty string, but this field must be non-empty.\nTried to update email to empty string, but this field must be non-empty.\nTried to update description to a length of 501, but max length is 500.", res.errorReason);
            Assert.NotEqual("",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.Username );
            Assert.NotEqual("",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.FirstName ); 
            Assert.NotEqual("",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.LastName ); 
            Assert.Equal("",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.Description );
            Assert.NotEqual("",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.Email ); 
        }

        {
            //vellykket update af user
            accountToUpdate.Username = "update";
            accountToUpdate.FirstName = "update";
            accountToUpdate.LastName = "update";
            accountToUpdate.Description = "update";
            accountToUpdate.Email = "update";
            accountToUpdate.ProfilePicture =
                "";
            accountToUpdate.ProfilePictureType = "image/png";
            UpdateAccountResponse res = await client.AdminService.UpdateAccountAsync(new UpdateAccountRequest(accountToUpdate));

            Assert.Equal("",res.errorReason);
            Assert.Equal("update",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.Username);
            Assert.Equal("update",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.FirstName);
            Assert.Equal("update",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.LastName);
            Assert.Equal("update",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.Description);
            Assert.Equal("update",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.Email);
            Assert.Equal("",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.ProfilePicture);
            Assert.Equal("image/png",client.AdminService.GetAccountAsync(new GetAccountRequest(accountToUpdate.AccountId)).Result.ProfilePictureType);
            

        }
        
        
        
        
    }
    
    
    
    //get users approved useres = alle users der har status approves
    [Fact]
    public async Task Test_getAllApprovedUsers()
    {
        List<Account> allApprovedAccounts = (List<Account>)await client.AdminService.GetApprovedUsersAsync();
        Assert.Equal(5,allApprovedAccounts.Count);
        foreach (Account a in allApprovedAccounts)
        {
            Assert.Equal(Account.STATUS_ACCEPTED, a.Status);
        }
        
    }
    
    //get users waiting for approvel, alle users skal have status pending
    [Fact]
    public async Task Test_GetUsersWaitingForApproval()
    {
        List<Account> accountsWaitingForApproval = await client.AdminService.GetUsersWaitingForApprovalAsync();
        Assert.Single(accountsWaitingForApproval);
        foreach (Account a in accountsWaitingForApproval)
        {
            Assert.Equal(Account.STATUS_PENDING, a.Status);
        }
    }
    
    
    //Tester login funktionen i admin client
    [Fact]
    public async Task Test_AdminLogin() {
        {
            //Login med admin bruger 
            LoginRequest req = new LoginRequest("Bob", "bobersej", true);
            LoginResponse res = await client.AuthService.LoginAsync(req);
            Assert.True(res.loginSuccessful);
            Assert.Equal("",res.errorReason);
        }
        {
            //login med admin brugernavn, forkert password
            LoginRequest req = new LoginRequest("Bob", "boberikkesej", true);
            LoginResponse res = await client.AuthService.LoginAsync(req);
            Assert.False(res.loginSuccessful);
            Assert.Equal("Can't find account, invalid credentials",res.errorReason);
        }
        
        {
            //Login med ikke admin bruger
            LoginRequest req = new LoginRequest("rune", "runerune", true);
            LoginResponse res = await client.AuthService.LoginAsync(req);
            Assert.False(res.loginSuccessful);
            Assert.Equal("Admin account required for admin client",res.errorReason);
        }
        
        {
            //login med ikke registreret account 
            LoginRequest req = new LoginRequest("Marie", "ikkebruger", true);
            LoginResponse res = await client.AuthService.LoginAsync(req);
            Assert.False(res.loginSuccessful);
            Assert.Equal("Can't find account, invalid credentials",res.errorReason);
        }
        
    }

    //Update user status
    [Fact]
    public async Task Test_User_Status()
    {
        //Ændre fra pending til accepted
        {
            Account account = await client.AdminService.GetAccountAsync(new GetAccountRequest(6));
            Assert.Equal(Account.STATUS_PENDING,account.Status);
            UpdateUserStatusResponse res = await client.AdminService.UpdateUserStatusAsync(account, Account.STATUS_ACCEPTED);
            Assert.True(res.b);
            Assert.Equal(Account.STATUS_ACCEPTED, client.AdminService.GetAccountAsync(new GetAccountRequest(6)).Result.Status);
        }
        
        //Ændre fra Accepted til Deleted
        {
            Account account = await client.AdminService.GetAccountAsync(new GetAccountRequest(1));
            Assert.Equal(Account.STATUS_ACCEPTED,account.Status);
            UpdateUserStatusResponse res = await client.AdminService.UpdateUserStatusAsync(account, Account.STATUS_DELETED);
            Assert.True(res.b);
            Assert.Equal(Account.STATUS_DELETED, client.AdminService.GetAccountAsync(new GetAccountRequest(1)).Result.Status);
        }
        TestUtil.ResetDatabase();
        //Ændre fra pending til deleted
        {
            Account account = await client.AdminService.GetAccountAsync(new GetAccountRequest(6));
            Assert.Equal(Account.STATUS_PENDING,account.Status);
            UpdateUserStatusResponse res = await client.AdminService.UpdateUserStatusAsync(account, Account.STATUS_DELETED);
            Assert.True(res.b);
            Assert.Equal(Account.STATUS_DELETED, client.AdminService.GetAccountAsync(new GetAccountRequest(6)).Result.Status);
        }
        
       
        

    }

   
    
}
